<script>
        let allGpxLayer = null;

        // 🎨 Paleta czerwonych odcieni
        const colorPalette = [
            '#DC143C', '#B22222', '#CD5C5C', '#FF6347',
            '#8B0000', '#F08080', '#BC8F8F', '#DB7093'
        ];

        // 🔢 Funkcja przypisująca kolor na podstawie nazwy
        function getColorByName(name) {
            let hash = 0;
            for (let i = 0; i < name.length; i++) {
                hash = name.charCodeAt(i) + ((hash << 5) - hash);
            }
            const index = Math.abs(hash) % colorPalette.length;
            return colorPalette[index];
        }

        window.addEventListener("DOMContentLoaded", function () {
            function toggleAllGpxLayer() {
                const map = map_a16eaa7a326ebb1173b65b937f00df93;
                const zoom = map.getZoom();

                if (zoom >= 10 && !allGpxLayer) {
                    fetch('../gpx/simplified_trails.geojson')
                        .then(res => res.json())
                        .then(data => {
                            const groupLayers = [];

                            L.geoJSON(data, {
                                style: function(feature) {
                                    const name = feature.properties && feature.properties.name ? feature.properties.name : '';
                                    return {
                                        color: getColorByName(name),
                                        weight: 2,
                                        opacity: 0.7
                                    };
                                },
                                onEachFeature: function (feature, layer) {
                                    if (feature.geometry.type === "LineString") {
                                        const coords = feature.geometry.coordinates;

                                        // Tooltip z nazwą trasy
                                        if (feature.properties && feature.properties.name) {
                                            layer.bindTooltip(feature.properties.name, { sticky: true });
                                        }

                                        // Podświetlanie po najechaniu
                                        layer.on({
                                            mouseover: function () {
                                                layer.setStyle({ weight: 5, color: '#ff69b4' });
                                            },
                                            mouseout: function () {
                                                const originalColor = getColorByName(feature.properties.name || '');
                                                layer.setStyle({ weight: 2, color: originalColor });
                                            }
                                        });

                                        // Start i koniec trasy
                                        const startMarker = L.circleMarker([coords[0][1], coords[0][0]], {
                                            radius: 3,
                                            color: "green",
                                            fillColor: "green",
                                            fillOpacity: 1
                                        });
                                        const endMarker = L.circleMarker([coords[coords.length - 1][1], coords[coords.length - 1][0]], {
                                            radius: 3,
                                            color: "blue",
                                            fillColor: "blue",
                                            fillOpacity: 1
                                        });

                                        const group = L.layerGroup([layer, startMarker, endMarker]);
                                        groupLayers.push(group);
                                    }
                                }
                            });

                            allGpxLayer = L.layerGroup(groupLayers);
                            allGpxLayer.addTo(map);
                        });
                }

                if (zoom < 10 && allGpxLayer) {
                    map.removeLayer(allGpxLayer);
                    allGpxLayer = null;
                }
            }

            const map = map_a16eaa7a326ebb1173b65b937f00df93;
            map.on('zoomend', toggleAllGpxLayer);
            toggleAllGpxLayer();
        });
    </script>
